import React from 'react';
import { Text,StyleSheet} from 'react-native';

const TitleText = props =>
 <Text style= {{...styles.title, ...props.style}}>{props.children}</Text>;

const styles = StyleSheet.create({
        title:{
      fontFamily:'bold',
      fontSize:18,
      color:'white'
        }
});


export default TitleText;
